from heapq import heappop, heappush, heapify

class HeapWithUpdate:
    def __init__(self, t):
        self.heap = [t]

    def insert(self, value):
        # Push the tuple (int, str) into the heap
        heappush(self.heap, value)

    def extract_min(self):
        # Pop and return the tuple with the minimum integer value
        if len(self.heap) > 0:
            return heappop(self.heap)
        return None

    def get_min(self):
        # Return the tuple with the minimum integer value without popping it
        return self.heap[0] if self.heap else None

    def find_index(self, strVal):
      for index, (current_int, current_str) in enumerate(self.heap):
        if (current_str == strVal):
          return index
      return -1  # Return -1 if the item is not found

    def update_node(self, index, new_tuple):
        # Update the value of the node with the same str value
        new_int, new_str = new_tuple
        current_int, current_str = self.heap[index]
        if current_str == new_str and current_int > new_int:
          self.heap[index] = new_tuple
          heapify(self.heap)
          return(True)

        return(False)

    def display(self):
        # Display the current state of the heap
        print(self.heap)

# node_info(f, g, h, parent, edge_cost)
class Node:
    def __init__(self, g_value, h_value, parent_node, edge_cost):
        self.g      =   g_value
        self.h      =   h_value
        self.f      =   g_value + h_value
        self.parent =   parent_node
        self.edge_cost= edge_cost

    def update_values(self, g_value, parent_node, edge_cost):
        self.g      =   g_value
        self.f      =   g_value + self.h
        self.parent =   parent_node
        self.edge_cost= edge_cost

# A_star(graph:dic, startNode:str goalNode:str, heuristic_values:dic, open_list:list, close_list:set, info:dic )
class A_Star_01:

    def __init__(self, graph:dict, start:str, goal:str, heuristic_values:dict):
        self.graph            =   graph
        self.startNode        =   start
        self.goalNode         =   goal
        self.heuristic_values =   heuristic_values
        self.open_list        =   HeapWithUpdate((heuristic_values[start], start))
        self.closed_list      =   set()
        self.openedNodesDB    =   {start:Node(0, heuristic_values[start], None, 0)}

    def nodeInOpenList(self, node):
      return(self.openedNodesDB.get(node))


    def addNeighboursToOpenList(self, currNode, g_currNode):

        for neighbor, edge_cost in self.graph[currNode]:
            if neighbor in self.closed_list:
                continue

            g_neighbor = g_currNode + edge_cost
            f_neighbor =  g_neighbor + self.heuristic_values[neighbor]
            index = self.open_list.find_index(neighbor)
            if(index!=-1):
              nodeUpdated = self.open_list.update_node(index, (f_neighbor, neighbor))
              if(nodeUpdated):
                self.openedNodesDB[neighbor].update_values(g_neighbor, currNode, edge_cost)
            else:
              self.open_list.insert((f_neighbor, neighbor))
              self.openedNodesDB[neighbor] = Node(g_neighbor, self.heuristic_values[neighbor], currNode, edge_cost)


    def print_path(self):

      path  = []
      n     = self.goalNode
      while (n!=None):
        path.append((n, self.openedNodesDB[n].h, self.openedNodesDB[n].edge_cost))
        n = self.openedNodesDB[n].parent

      path.reverse()
      return(path)


    def a_star_search(self):
        while self.open_list:
            f_currNode, currNode = self.open_list.extract_min()

            if (currNode in self.closed_list):
              continue
            elif (currNode == self.goalNode):
              return 1
            else:
              self.closed_list.add(currNode)

            # Subtract the heuristic value as it was overcounted.
            g_currNode =  f_currNode - self.heuristic_values[currNode]
            self.addNeighboursToOpenList(currNode, g_currNode)

        return -1  # No path found

